    price: 399,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
    isLike: false,
    isAdd: false,
  },
  {
    name: `Кастомна чашка з фото "Моя ти зайка"`,
    price: 399,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
    isLike: false,
    isAdd: false,
  },
];

const App = () => {
  const [token, setToken] = useState("");
  useEffect(() => {
    console.log(token);
  }, [token]);
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="" element={<HomePage />} />
        <Route path="page" element={<CartPage />} />
        <Route path="cart" element={<CartPage />} />
        <Route
          path="autorization"
          element={<Autorization token={token} setToken={setToken} />}
        />
        <Route
          path="registration"
          element={<Autorization token={token} setToken={setToken} />}
        />
        <Route
          path="cupsWidthPhotos"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
            />
          }
        />
