          path="chameleon"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
            />
          }
        />
        <Route
          path="BisSize"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
